    const {
      currentTarget: { value },
    } = event;
    console.log(event.currentTarget.value);
  };
  return (
    <div>
      <form>
        <input
          onChange={onChage}
          type="text"
          placeholder="username"
          value={value}
        />
        <button>Log in</button>
      </form>
    </div>
  );
}

export default App;
